function rotate(dir) {
    if(dir=='cw'){
        this.position++;
        this.setRotation(this.getRotation()-this.theta*Math.PI/180)
    }
    else {
        this.position--;
        this.setRotation(this.getRotation()+this.theta*Math.PI/180)
    }
}

